def clear_screen():
	if (platform.system() == 'Windows') :
		os.system('cls')
	else:
		os.system('clear')

def print_whitelines(number_of_lines):
	for _ in range(number_of_lines):
		print(" ")

def print_in_pounds(word, word_length):
	green_pound = colored("#", 'green')
	print(" "*10 + green_pound * (word_length+6))
	print(" "*10 + green_pound + "  " + word + "  " + green_pound)
	print(" "*10 + green_pound * (word_length+6))

def print_uncypher(word):
	clear_screen()
	cypher_letters = string.ascii_letters + string.digits + string.punctuation
	uncyphering_word = ""
	for letter in word:
		uncyphering_word = uncyphering_word + letter
		for _ in range(100):
			cypher_buffer = ""
			for _ in range(len(word)-len(uncyphering_word)):
				cypher_buffer = cypher_buffer + random.choice(cypher_letters)
			cypher_buffer = colored(cypher_buffer,'green')
			printed_uncyphered = colored(uncyphering_word, 'red')
			clear_screen()
			print_whitelines(10)
			print_in_pounds(printed_uncyphered + cypher_buffer, len(word))
			print_whitelines(10)

